import React from 'react';
import { Container } from 'react-bootstrap';
import './style.css';

type Props = {};
type State = {};

export default class Thankyoupage extends React.Component<Props, State> {

    state = {} as State;

    constructor(props: Props) {
        super(props);
    }

    render(){
        return (
            <div className="thank">
                <Container>
                    hi
                </Container>
            </div>
        )
    }
}
